import React from 'react';

import {Spring} from 'react-spring/renderprops';



const Animation = (props) => {
<Spring
from ={{ 
    opacity: 0 , 
    color: 'pink' , 
    transition: '5s'
    }}

to ={{ 
    opacity:  6, 
    color: 'green' , 
    transition: '5s'
    }}>


</Spring>

 return (
     props =>
        <div style={props}>hello</div>


 )
};

export default Animation;
